const Header = () => {
    return (
      <div className="header">
        <img src={process.env.PUBLIC_URL + '/favicon.ico'} alt="logo" className="logo" />
        <img src={process.env.PUBLIC_URL + '/favicon.ico'} alt="profile" className="profile" />
      </div>
    );
  };
  
  export default Header;
